export default function Card(props) {
  let card = props.children[0];
  return(
    <div 
      className="card" 
      key={card.id}
      id={card.id}
      data-when={card.year}
      data-noselect="noselect">
      <span className="date">{card.dateToString}</span>
      <img alt="Clue" src={card.img} />
      <span className="info">{card.info}</span>
    </div>
  );
}
